import React from 'react';
import ReactDOM from 'react-dom/client';

function Panel(){
    return(<div></div>)
}

function App(){
    return(
        <Panel>test</Panel>
    )
}

const root = ReactDOM.createRoot(document.getElementById("root"));
root.render(<App></App>);
